import './App.css';
import { Layout } from 'antd'
const { Header, Sider, Content, Footer } = Layout;

function App() {
  return (
    <div className="App">
      <Layout>
        <Header>header</Header>
        <Layout>
          <Sider>left sidebar</Sider>
          <Content>main content</Content>
          <Sider>right sidebar</Sider>
        </Layout>
        <Footer>footer</Footer>
      </Layout>
    </div>
  );
}

export default App;
